import React from "react";
import styled from "styled-components";
import phoneShop from "../assets/projects/phone-shop.png";
import journey from "../assets/projects/journey.png";
import netflix from "../assets/projects/netflix.png";
import taskool from "../assets/projects/taskool.mp4";
import huddle from "../assets/projects/huddle.mp4";
import ham from "../assets/projects/theHam.mp4";
import createNote from "../assets/projects/createNote.mp4";
import findGiphy from "../assets/projects/findGiphy.mp4";
import knowladge from "../assets/projects/knowladge.mp4";
import musica from "../assets/projects/musica.mp4";
import numberPricing from "../assets/projects/numberPricing.mp4";
const Projects = () => {
  return (
    <ProjectsContainer id="projects">
      <h2>Some Example Projects</h2>
      <div>
        <h3>HTML , CSS ,JS, Jquery , Bootstrap </h3>
        <div>
          <img src={phoneShop} alt="" />
          <img src={journey} alt="" />
          <img src={netflix} alt="" />
          <video muted autoPlay loop src={musica} />
          <video muted autoPlay loop src={ham} />
          <video muted autoPlay loop src={taskool} />
          <video muted autoPlay loop src={huddle} />
          <video muted autoPlay loop src={knowladge} />
          <video muted autoPlay loop src={createNote} />
          <video muted autoPlay loop src={findGiphy} />
          <video muted autoPlay loop src={numberPricing} />


          
        </div>
      </div>
    </ProjectsContainer>
  );
};

export default Projects;

const ProjectsContainer = styled.div`
  img,
  video {
    width: 450px;
    margin: 15px;
    height: 250px;
    object-fit: contain;
    background-color: gray;
    :hover {
      transform: scale(1.1);
      transition: all 0.4s ease-in-out;
    }
  }
`;
